import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";
// import Data from "../Data/data";
const NavBar = () => {
//   Data.map((element, index) => {
//     return(    <Link>{element.name}</Link>
// )
//   });
  return (
    <div id="main-menu">
      <div className="main-menu">
        <label id="hamburger-menu">
          <input type="checkbox" />
          <span className="menu">
            {" "}
            <span className="hamburger"></span>{" "}
          </span>
          <ul className="ul">
            <li>
              {" "}
              <a href="/">Home</a>{" "}
            </li>
            <li>
              {" "}
              <a href="/">Order</a>{" "}
            </li>
            <li>
              {" "}
              <Link to="/">Leaderboards</Link>{" "}
            </li>
            <li>
              {" "}
              <Link to="/">Marketplace</Link>{" "}
            </li>
            <li>
              {" "}
              <Link to="/faqs">FAQs</Link>{" "}
            </li>
          </ul>
        </label>
      </div>
      <div className="div">
        <Link to="/home">
          <img className="logo" src="./images/Twenteefore - Logo 2.png" alt="logo" />
        </Link>
        <nav className="navbar">
          {" "}
          <Link className="homeLink" to="/">
            Home
          </Link>
          <Link className="orderLink" to="/">
            Order
          </Link>
          <Link className="leaderboardsLink" to="/">
            Leaderboards
          </Link>{" "}
          <Link className="marketplaceLink" to="/">
            Marketplace
          </Link>{" "}
          <Link className="faqsLink" to="/faqs">
            FAQs
          </Link>
        </nav>
      </div>
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
